import React, { FC } from "react";

const PageNotFound: FC = () => {
	return (
		<div className="not-found">
			<h1>Page Not Found</h1>
			<p>Sorry, the page you are looking for does not exist.</p>
		</div>
	);
};

export default PageNotFound;
